const randomElement = (array) => {
    return array[Math.floor(Math.random() * array.length)];
};
const defaults = {
    adjectiveCount: 1,
    seperator: '-',
};
const generate = ({ adjectiveCount, seperator } = {}) => {
    let options = defaults;
    if (adjectiveCount) {
        options.adjectiveCount = adjectiveCount;
    }
    if (seperator) {
        options.seperator = seperator;
    }
    const adjs = Array.from({
        length: options.adjectiveCount
    }, () => randomElement(adjectives));
    const animal = randomElement(animals);
    return [...adjs, animal].join(options.seperator);
};

export { adjectives, animals, generate as default, generate };
